import { Sign } from "crypto";
import { ActionTypes } from "../action-types";
import { SignIn } from '../actions/signin-action';


export const signin = ({ email, password: string }): SignIn => {
    console.log("SIGNIN Action");
    return {
        type: ActionTypes.SIGN_IN,
        payload: {
            email: "myemail",
            password: "mypassword"
        }
    }
}
